import React from 'react';
import { useNavigate } from 'react-router-dom';
import './Dashboard.css'; // Import CSS

const Dashboard = () => {
  const navigate = useNavigate();

  const handleViewClubs = () => {
    navigate('/clubs');
  };

  const handleViewEvents = () => {
    navigate('/events');
  };

  const handleViewResources = () => {
    navigate('/resources');
  };

  const handleDeleteAccount = () => {
    navigate('/delete-account');
  };

  const handleLogout = () => {
    navigate('/logout');
  };

  return (
    <div className="dashboard">
      <h1>Dashboard</h1>
      <div className="button-container">
        <button className="dashboard-button" onClick={handleViewClubs}>
          View All Clubs
        </button>
        <button className="dashboard-button" onClick={handleViewEvents}>
          View All Events
        </button>
        <button className="dashboard-button" onClick={handleViewResources}>
          View All Resources
        </button>
      </div>
      <div className="action-container">
        <button className="action-button" onClick={handleDeleteAccount}>
          Delete Account
        </button>
        <button className="action-button" onClick={handleLogout}>
          Logout
        </button>
      </div>
    </div>
  );
};

export default Dashboard;
